        private async Task SendGroups(byte floor)
        {
            var result = new Floor();
            var filePath = DirectoryManeger.GetAbsotoblePath("/gropus/floor_group.xml");
            if (File.Exists(filePath))
            {
                try
                {
                    XElement xml = XElement.Load(filePath);
                    //メンバー情報のタグ内の情報を取得する
                    IEnumerable<XElement> infos = from x in xml.Elements("Floor")
                                                                      where x.Element("identity").Value == floor.ToString()
                                                                      select x;
                    foreach (XElement info in infos)
                    {
                        xml = info;
                        break;
                    }
                    result.floorTitle = xml.Element("BuildingName").Value +"　" +xml.Element("Number").Value + "F";
                    infos = from x in xml.Elements("Groups")
                                select x.Element("Group");
                    foreach (var item in infos)
                    {
                        using(StreamReader sr = new StreamReader(item.Element("Inifile").Value))
                        {
                            var content = await sr.ReadToEndAsync();
                            List<GroupJson> jsons = JsonSerializer.Deserialize<List<GroupJson>>(content);
                            List<GroupMap> groups = new List<GroupMap>();
                            foreach (var json in jsons)
                            {
                                GroupMap group = new GroupMap();
                                var serial = json.Convert();
                                group.name = serial.name;
                                group.comment = serial.comment;
                                group.id = serial.id;
                                group.location = serial.id;
                                using (Image image = Image.Load(DirectoryManeger.GetWebStoragePath(serial.posterUrl[0].Url)))
                                {
                                    if (image.Width > image.Height)
                                    {
                                        group.isWide = true;
                                    }
                                }
                                group.posterUrl = serial.posterUrl[0].Url;
                            }
                        }
                    }
                    Console.WriteLine("Serialize!");
                    using (MemoryStream ms = new MemoryStream())
                    {
                        XmlSerializer xs = new XmlSerializer(typeof(Floor));
                        xs.Serialize(ms, result);
                        await Clients.Caller.SendAsync("ReceiveGroups", Encoding.UTF8.GetString(ms.ToArray()));
                    }
                }
                catch
                {
                    SendGroupsDev();
                }
            }
        }
