        private async Task SendGreads()
        {
            Dictionary<string, string> map = new Dictionary<string, string>()
            {
                {"中学1年生","/gread/j1.csv"},
                {"中学2年生","/gread/j2.csv"},
                {"中学3年生","/gread/j3.csv"},
                {"高校1年生","/gread/h1.csv"},
                {"高校2年生","/gread/h2.csv"},
                {"高校3年生","/gread/h3.csv"},
                {"その他","/gread/other.csv"},
            };
            var result = new List<Floor>();
            foreach (var item in map)
            {
                var floor = new Floor();
                var filePath = DirectoryManeger.GetAbsotoblePath(item.Value);
                floor.floorTitle = item.Key;
                try
                {
                    if (File.Exists(filePath))
                    {
                        List<string> vs = new List<string>();
                        using (StreamReader sr = new StreamReader(filePath))
                        {
                            vs.Add(sr.ReadLine());
                        }
                        foreach (var groupFile in vs)
                        {
                            var reader = new GroupReader();
                            var serial = await reader.Read(groupFile);
                            var group = new GroupMap();
                            group.name = serial.name;
                            group.comment = serial.comment;
                            group.id = serial.id;
                            group.location = serial.id;
                            floor.groups.Add(group);
                        }
                    }
                    result.Add(floor);
                }
                catch
                {
                    
                }

            }
            Console.WriteLine("Serialize!");
            using (MemoryStream ms = new MemoryStream())
            {
                XmlSerializer xs = new XmlSerializer(typeof(List<Floor>));
                xs.Serialize(ms, result);
                await Clients.Caller.SendAsync("ReceiveGreads", Encoding.UTF8.GetString(ms.ToArray()));
            }
        }
